def inversComplement(input):
    output = ''
    for letter in input:
        #print(letter)
        if letter == 'A':
            output += 'T'
        elif letter == 'T':
            output += 'A'
        elif letter == 'G':
            output += 'C'
        else:
            output += 'G'
        #print(output)
    return (output[::-1])

#input
seq = ""
print(inversComplement(seq))
